 of not being bound by the opinions that others choose to display in regards to the decisions that one chooses to make on a daily weekly, or lifetime basis. ", "In order to be free we have to be willing to think for ourselves, learn for our selves, and to live our lives as our real true selves. Being free is when you are able to stand up and speak in public spewing your beliefs not caring what anyone else will think of them. ", "Being free is when you are able to go against the grain, when you are able to make a left when everyone else is going right, and not worry about why everyone is talking about you, or looking at you in a manner that is unfavorable, and with faces that blatantly say that they don't approve of your choices. ", "One of the greatest challenges is being yourself in a world that's trying to make you like everyone else."]}}, "quontity": {"\u043f\u043e\u0434\u043f\u0438\u0441\u0447\u0438\u043a\u043e\u0432": "5.9M", "\u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0438": "254", "\u043f\u043e\u0434\u0430\u0440\u043a\u043e\u0432": "241K"}}
